広告文責/販売会社:株式会社Hanbit TEL:050-1040-7307<br><br><br><br><font color="#BF0000"><b>■関連商品</b></font><hr color="#BF0000"><br><b>本商品のサイズ、色違い、関連商品はこちら</b><br><br><br><font color="#BF0000"><b>■商品内容</b></font><hr color="#BF0000"><br><br>原着ナイロンの４つの特徴<br>【1防汚性】　　<br>●繊維の断面が四角中空糸なので汚れが目立ちません。<br>　がんこな汚れも除去しやすく、本来の色を保ちます。<br>【2耐久性】　<br>●歩行による摩擦がもたらす表面の色落ちが少なく、<br>　弾性回復力も優れています。<br>【3耐候性】　　<br>●直射日光による色褪せが少ない素材です。耐光堅ろう度<br>　試験でも性能を実証。開口部の広い空間にもお使いいただけます。<br>【4耐薬品性】　<br>●塩素系漂白剤や薬品に対して耐性があり色落ちにしく<br>　い素材です。クリーニングに漂白剤を用いる場合にも安心です。<br>【防炎機能】　<br>●日本防炎協会の防炎性能試験に合格したものです。<br>　サンゲツカーペットタイルは全て防炎認定品です。<br>【静電機能】　<br>●パイルやラテックス等に帯電防止加工をした、又は繊維自体<br>　に制電性能を有した素材を使ったカーペットタイルです。<br>【防汚機能】　<br>●繊維の異形断面構造が光を反射・吸収・透過させ、<br>　汚れが目立ちにくくなってます。<br> 【歩行性】　<br>● 通行量の多い場所に適してます。 店舗・オフィス・銀行・他<br>【施工上のご注意】<br>●下地から絶えず湿気の上昇がありえる場合では使用を避けてください。<br>　施工後に剥がれや臭気が発生するおそれがあります。<br>●オゾンを発生させる空気清浄機や窒素酸化ガスの影響をうけやすい場所<br>　ではパイルが変色するおそれがあります。<br>●素材固有の臭いがあります。特に施工直後は換気を心がけてください。<br>【注意事項】　<br>●ご注文前にサイズ・色・数量等お間違え無いよう<br>　ご確認お願いいたします。<br>●写真と実際の商品では色や質感が異なる場合があります。<br>　予めご了承ください。<br>【返品について】<br>●受注後のキャンセルや返品はお断りさせて頂いております。<br>　予めご了承ください。　　　<br><br><br><br><font color="#BF0000"><b>■商品スペック</b></font><hr color="#BF0000"><br><br>【組成】　<br>●原着ナイロン１００％  （アントロン ルーミナTM6.6ナイロン）<br>【バッキング】　<br>●PVC+ガラス不織布<br>【パイル長】　<br>●3.5ｍｍループ　（全厚6.5ｍｍ）<br>【パイル密度】　<br>●1/10G×8.8ST<br>【サイズ】<br>●50cm×50cm<br>【性能】　<br>●JIS認定コード：JIS　L　4406 JIS認定番号：QT0508004<br>　防炎認定番号：　E　2120120  静電性：　1KV以下<br>【梱包サイズ】　<br>●20枚セット　約　縦52cm×横52cm×高16cm<br>【梱包重量】<br>●約　26.2kg<br>【生産国】　<br>●日本<br>【施工方法】<br>● 全面接着工法　市松貼りをおすすめします。<br>【推奨接着材】　<br>●サンゲツ　ベンリダインGT<br><br><br><br>　<br><br>　<br><br><br><br>■関連カテゴリ<br>タイルカーペット、タイルマット、クッションフロアマット、ジョイントマット、キッチン、耐熱性、DIY、たいるかーぺっと、たいるまっと、くっしょんふろあまっと<br><br><br><br><font color="#BF0000"><b>■送料・配送についての注意事項</b></font><hr color="#BF0000"><br>●本商品の出荷目安は<b>【3 - 6営業日　※土日・祝除く】</b>となります。<br><br>●お取り寄せ商品のため、稀にご注文入れ違い等により欠品・遅延となる場合がございます。<br><br>●本商品は同梱区分<b>【TS1851】</b>です。同梱区分が<b>【TS1851】</b>と記載されていない他商品と同時に購入された場合、梱包や配送が分かれます。<br><br>●沖縄、離島および一部地域への配送時に追加送料がかかる場合がございます。<style type="text/css">
